import { Component } from '@angular/core';
import { RouterOutlet } from '@angular/router';

@Component({
  selector: 'app-root',
  imports: [RouterOutlet],
  templateUrl: './app.component.html',
  styleUrl: './app.component.css'
})
export class AppComponent {
  title = 'demo2';
}
<style>
* {
margin: 0;
padding: 0;
box-sizing: border-box;
font-family: 'Inter', sans-serif;
scroll-behavior: smooth;
}

:root {
--primary: #6366f1;
--primary-dark: #4f46e5;
--primary-light: #818cf8;
--primary-bg: #eef2ff;
--success: #10b981;
--error: #ef4444;
--text-dark: #1f2937;
--text-medium: #4b5563;
--text-light: #6b7280;
--border: #e5e7eb;
--border-focus: #a5b4fc;
--bg-light: #f9fafb;
--shadow-sm: 0 1px 2px 0 rgba(0, 0, 0, 0.05);
--shadow-md: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
--shadow-lg: 0 10px 15px -3px rgba(0, 0, 0, 0.1), 0 4px 6px -2px rgba(0, 0, 0, 0.05);
--yes-color: #10b981;
--no-color: #ef4444;
}

body {
background: linear-gradient(rgba(0, 0, 0, 0.6), rgba(0, 0, 0, 0.6)), url('/public/image.jpg');
background-size: cover;
background-position: center;
background-attachment: fixed;
color: var(--text-dark);
line-height: 1.6;
min-height: 100vh;
display: flex;
flex-direction: column;
}

/* Header and Navigation */
header {
background-color: rgba(255, 255, 255, 0.95);
backdrop-filter: blur(10px);
-webkit-backdrop-filter: blur(10px);
box-shadow: var(--shadow-md);
position: sticky;
top: 0;
z-index: 100;
}

.navbar {
display: flex;
justify-content: space-between;
align-items: center;
padding: 1rem 5%;
max-width: 1400px;
margin: 0 auto;
}

.logo {
font-size: 1.5rem;
font-weight: 700;
color: var(--primary-dark);
text-decoration: none;
display: flex;
align-items: center;
gap: 0.5rem;
}

.logo-icon {
width: 28px;
height: 28px;
fill: var(--primary);
}

.nav-links {
display: flex;
gap: 2rem;
list-style: none;
}

.nav-links a {
color: var(--text-medium);
text-decoration: none;
font-weight: 500;
transition: color 0.2s;
font-size: 0.95rem;
cursor: pointer;
}

.nav-links a:hover {
color: var(--primary);
}

.nav-links a.active {
color: var(--primary-dark);
font-weight: 600;
}

.nav-buttons {
display: flex;
gap: 1rem;
}

.nav-btn {
padding: 0.5rem 1rem;
border-radius: 8px;
font-weight: 600;
font-size: 0.9rem;
cursor: pointer;
transition: all 0.2s;
display: flex;
align-items: center;
gap: 0.5rem;
text-decoration: none;
}

.login-btn {
background-color: white;
color: var(--primary-dark);
border: 2px solid var(--primary-light);
}

.login-btn:hover {
background-color: var(--primary-bg);
}

.history-btn {
background-color: var(--primary);
color: white;
border: none;
box-shadow: var(--shadow-sm);
}

.history-btn:hover {
background-color: var(--primary-dark);
}

.mobile-menu-btn {
display: none;
background: none;
border: none;
font-size: 1.5rem;
color: var(--text-medium);
cursor: pointer;
}
</style>
<nav class="navbar">
  <div class="container-fluid d-flex"></div>
  <a href="#" class="logo">
    <svg class="logo-icon" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
      <path d="M21 12C21 16.9706 16.9706 21 12 21C7.02944 21 3 16.9706 3 12C3 7.02944 7.02944 3 12 3C16.9706 3 21 7.02944 21 12Z" stroke="currentColor" stroke-width="2"/>
      <path d="M12 8V16" stroke="currentColor" stroke-width="2" stroke-linecap="round"/>
      <path d="M8 12H16" stroke="currentColor" stroke-width="2" stroke-linecap="round"/>
    </svg>
    Oracle
  </a>

  <ul class="nav-links">
    <li><a href="#home" class="active">Home</a></li>
    <li><a href="#about">About</a></li>
    <li><a href="#features">Features</a></li>
    <li><a href="#contact">Contact</a></li>
  </ul>

  <div class="nav-buttons">
    <a href="/login" class="nav-btn login-btn">
      <svg width="16" height="16" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M15 3H19C19.5304 3 20.0391 3.21071 20.4142 3.58579C20.7893 3.96086 21 4.46957 21 5V19C21 19.5304 20.7893 20.0391 20.4142 20.4142C20.0391 20.7893 19.5304 21 19 21H15" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
        <path d="M10 17L15 12L10 7" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
        <path d="M15 12H3" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
      </svg>
      Login
    </a>
    <a href="/history" class="nav-btn history-btn">
      <svg width="16" height="16" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M12 8V12L15 15" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
        <path d="M3.05078 11.0002C3.27441 8.18983 4.51578 5.55733 6.53204 3.67879C8.54829 1.80025 11.1876 0.815969 13.9047 0.919535C16.6219 1.0231 19.1721 2.20601 21.0117 4.22C22.8513 6.23398 23.8228 8.94306 23.7119 11.7275C23.601 14.5119 22.4144 17.1408 20.4368 19.0801C18.4592 21.0193 15.8223 22.1125 13.0701 22.1351C10.318 22.1577 7.66359 21.1079 5.65407 19.2002C3.64455 17.2925 2.50492 14.6902 2.50078 12.0002" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
        <path d="M3.05078 16.0002H2.00078V11.0002H7.00078" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
      </svg>
      History
    </a>
    <a href="/decisionmaking" class="nav-btn decision-btn">

      Start
    </a>
  </div>

  <button class="mobile-menu-btn">☰</button>
</nav>
<!-- this is where Angular will swap in your routed pages -->
